<body>


    <div id="header" >
        <div id="logo" class="icon-logo"></div>
        <div id="title" class="HEADER h1"></div>    
        <div id="nav">
            <div class="h3 OPTIONS">Options</div>
            <input id="expand" type="button" class="optionBtn collapseOpenNodes" value="expand" onclick="checkExpandNodes('expand')"/>
                <input id="fold" type="button" class="optionBtn collapseOpenNodes" value="fold" onclick="checkExpandNodes('fold')"/>
                <div class="filterGroup">
                    Sort by:
                    <input id="rootObj" type="button" class="optionBtn filterButton selectedFilter" value="Root Objects" filtervalue="rootObj" onClick="filterNodes(this)" />
                    <!-- <input id="funcDomain" type="button" class="optionBtn filterButton" value="Functional Domains" filtervalue="funcDomain" onClick="filterNodes(this)" /> -->
                    <input id="generator" type="button" class="optionBtn filterButton" value="Generators" filtervalue="generator" onClick="filterNodes(this)" />
                </div>
        </div>
    </div>


    <div class="globalTables">
        <div id="validation-header">
            <div class="h3 MODULEHEAD">Validation Results</div>
        </div>
        <div id='validation-result'>
            <div class="pointer node rootNode space-to-icon close-node-icon node-width inline">
                <span class="icon-ValidationView elem inline">Validation Result</span>
            </div>
        </div>
                
        <div id="generation-header">
            <div class="h3 MODULEHEAD">Generation Results</div>
        </div>
        <div id='generation-result'>
            <div class="pointer node rootNode space-to-icon close-node-icon node-width inline">
                <span class="icon-ValidationView elem inline">Generation Process Result</span>
            </div>
        </div>
    </div>
